msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER_ABSOLUTE = Math.abs(msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER);
msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER_CHARGING = Math.abs(msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER >= 0 ? 0 : msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER);
msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER_DISCHARGING = Math.abs(msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER < 0 ? 0 : msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER);
msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1_ABSOLUTE = Math.abs(msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1);
msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1_EXPORTING = msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1 >= 0 ? 0 : Math.abs(msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1);
msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1_IMPORTING = msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1 < 0 ? 0 : Math.abs(msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1);


/*
As per AlphaESS DE Service Team
(Thanks)

House consumption = 
PV - feed-in (+ grid purchase) - 
battery charge (+ battery discharge)
*/
/*
battery power is minus if charging
battery power is positive if discharging
grid power is minus if feeding
grid power is positive if purchasing

*/

// msg.payload.CONSUMPTION is now exposed
// directly in Alpha2MQTT via the register
// 0xFFFE (REG_CUSTOM_LOAD)
// But leaving the calculation in for reference to show
// how it is derived and also how to manipulate input in
// node red.
msg.payload.CONSUMPTION =
    msg.payload.REG_PV_METER_R_TOTAL_ACTIVE_POWER_1
    -
    // Minus feeding, if feeding
    (msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1 < 0 ? Math.abs(msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1) : 0)
    +
    // Plus purchase, if purchasing
    (msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1 > 0 ? msg.payload.REG_GRID_METER_R_TOTAL_ACTIVE_POWER_1 : 0)
    -
    // Minus battery, if charging
    (msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER < 0 ? Math.abs(msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER) : 0)
    +
    // Plus battery, if discharging
    (msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER > 0 ? msg.payload.REG_BATTERY_HOME_R_BATTERY_POWER : 0);

return msg;
